import jsPDF from 'jspdf'
import {getYearLevel, getSem, toTitleCase, formatPrice} from "../Helper";
import {signature} from "./base64Image/Signature";

var img = 'data:image/png;base64,'



function printAssessment(student, subjects, schoolInfo, fees, user) {
    var doc = new jsPDF('p', 'pt', ['288', '792']);
    doc.setFont("times");
    doc.setFontStyle("normal");
    doc.setFontSize(8.5);
    doc.setFontStyle("italic");
    doc.setFontSize(8);
    doc.text("Student's Copy", 144, 16, null, null, 'center');
    page(doc, student, subjects, schoolInfo, fees, user);
    doc.setProperties({
        title: toTitleCase(student.user.name) + '_' + student.idnumber + '_REGISTRATION_FORM',
        subject: 'Registration Form',
        author: 'MinSU Enrollment',
        keywords: 'generated, Registration, Form, MinSU, Enrollment',
        creator: 'MinSU'
    });
//------------------------------------------------------------------------------------
    doc.addPage();
    doc.setFontStyle("italic");
    doc.setFontSize(8);
    doc.text("Accounting's Copy", 144, 16, null, null, 'center');
    doc.setFontStyle("normal");
    page(doc, student, subjects, schoolInfo, fees, user);
    doc.setProperties({
        title: toTitleCase(student.user.name) + '_' + student.idnumber + '_REGISTRATION_FORM',
        subject: 'Registration Form',
        author: 'MinSU Enrollment',
        keywords: 'generated, Registration, Form, MinSU, Enrollment',
        creator: 'MinSU'
    });
//==========================================================================================
    doc.addPage();
    doc.setFontStyle("italic");
    doc.setFontSize(8);
    doc.text("Registrar's Copy", 144, 16, null, null, 'center');
    doc.setFontStyle("normal");
    page(doc, student, subjects, schoolInfo, fees, user);
    doc.setProperties({
        title: toTitleCase(student.user.name) + '_' + student.idnumber + '_REGISTRATION_FORM',
        subject: 'Registration Form',
        author: 'MinSU Enrollment',
        keywords: 'generated, Registration, Form, MinSU, Enrollment',
        creator: 'MinSU'
    });

    window.open(doc.output('bloburl'), '_blank');
}

function page(doc, student, subjects, schoolInfo, fees, user) {
    var academic_year = student.cureffec;
    var grandTotal = 0;
    doc.setFontStyle("bold");
    doc.setFontSize(19);
    doc.setTextColor(155, 250, 132);
    doc.text('Free Higher Education', 274, 464, 50, null, 'right');
    doc.setTextColor("black");

    doc.setFontStyle("bold");
    doc.setFontSize(10);
    doc.setTextColor(0, 65, 0);
    doc.text(schoolInfo.name, 144, 33, null, null, 'center');
    doc.setTextColor(0, 0, 0);
    doc.setFontSize(10);
    doc.setFontStyle("normal");
    doc.text(schoolInfo.adddress, 144, 44, null, null, 'center');
    doc.setFontStyle("bold");

    doc.text('Assessment Slip', 144, 70, null, null, 'center');
    doc.setFontStyle("italic");
    doc.text('AY :' + academic_year, 144, 80, null, null, 'center');

    doc.setFontSize(10);
    doc.setFontStyle("normal");

    doc.text('Name: ' + toTitleCase(student.user.name), 5, 99, null, null, 'left');

    doc.text('ID No.: ' + student.idnumber, 178, 99, null, null, 'left');
    doc.text('Program: ' + student.program.corcode + (!student.program.cormajor === 'NONE' ? toTitleCase(student.program.cormajor) : ''), 5, 111, null, null, 'left');
    doc.text('Curr. Year: ' + toTitleCase(getYearLevel(student.yearlevel)), 178, 111, null, null, 'left');
    doc.text('No. of Units: ' + (subjects != null ? '' + subjects.unitsCount : ''), 5, 122, null, null, 'left');
    doc.text('No. of Lab: ' + (subjects != null ? '' + (subjects.comlabCount > 0 ? subjects.comlabCount : subjects.laboratoriesCount) : ''), 178, 122, null, null, 'left');
    doc.text('No. of Subj: ' + (subjects != null ? '' + subjects.subjectCount : ''), 5, 133, null, null, 'left');
    doc.text('No. of Tech: ', 178, 133, null, null, 'left');

    doc.setLineWidth(0.01)
    doc.setDrawColor(0, 0, 0);
    //doc.setLineDash([.5])
    doc.line(.3, 144, 288, 144)

    doc.setFontStyle("bold");
    doc.text('PARTICULARS', 30, 153, null, null, 'left');
    doc.text('AMOUNT', 200, 153, null, null, 'left');
    doc.line(.3, 155, 288, 155)
    // title
    //--------------------------------------
    // PRINTING FEES
    //--------------------------------------
    var yPos = 155
    Object.keys(fees).forEach(function (key) {
        yPos = yPos + 11;
        doc.setFontStyle("bold");
        doc.text('' + key.toUpperCase(), 5, yPos, null, null, 'left');
        doc.setFontStyle("normal");

        fees[key].map((fee) => {
            yPos = yPos + 11;
            doc.text('' + fee.feename, 10, yPos, null, null, 'left');
            doc.text('' + fee.feeamount1, 270, yPos, null, null, 'right');
            grandTotal += parseFloat(Number(fee.feeamount1.replace(/[^0-9.-]+/g, "")))
        })
    })

    //--------------------------------------
    // END OF PRINTING FEES
    //--------------------------------------
    yPos = yPos + 22;
    doc.setFontStyle("bold");
    doc.text('GRAND TOTAL', 10, yPos, null, null, 'left');
    doc.text(formatPrice(parseFloat(grandTotal).toFixed(2)), 270, yPos, null, null, 'right');

    yPos += 5
    doc.setLineWidth(0.01)
    doc.setLineDash(0)
    doc.line(.3, yPos, 288, yPos)
    yPos += 22
    doc.setFontStyle("normal");
    doc.text('Assessed by:', 5, yPos, null, null, 'left');
    yPos += 22
    doc.setFontStyle("bold");
    doc.text('' + user.name, 40, yPos, null, null, 'left');
    doc.addImage(img, 'png', 75, yPos-35, 50, 50)
    doc.text('' + new Date().toLocaleDateString(), 260, yPos, null, null, 'right');
    yPos += 11
    doc.setFontSize(10);
    doc.setFontStyle("normal");
    doc.text('' + user.position, 70, yPos, null, null, 'left');
    doc.text('Date', 250, yPos, null, null, 'right');
    yPos += 22
    doc.setFontSize(10);
    doc.text('Payments:', 5, yPos, null, null, 'left');
    yPos += 11
    doc.text('Date: __________', 10, yPos, null, null, 'left');
    doc.text('OR #: ___________', 100, yPos, null, null, 'left');
    doc.text('Amt: _________', 210, yPos, null, null, 'left');
    yPos += 11
    doc.text('Date: __________', 10, yPos, null, null, 'left');
    doc.text('OR #: ___________', 100, yPos, null, null, 'left');
    doc.text('Amt: _________', 210, yPos, null, null, 'left');
    yPos += 11
    doc.text('Date: __________', 10, yPos, null, null, 'left');
    doc.text('OR #: ___________', 100, yPos, null, null, 'left');
    doc.text('Amt: _________', 210, yPos, null, null, 'left');

}

export {printAssessment}
